import React from 'react';
import {withFormik} from 'formik';
import styled from 'styled-components';
import './signUp.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';

const FormHolder = styled.form`
display:flex;
flex-direction: column;
width:40%;
// height: 50vh;
padding:2.5rem;
margin: 5rem 1rem;
border-radius: 10px;
box-shadow: 5px 5px 5px 5px lightgrey;
background-color: #00B2EE;
color: white;
text-shadow: -1px -1px 0 #003F87, 1px 1px 0 #003F87, 0 -1px 0 #003F87, 0 1px 0 #003F87, 1px -1px 0 #003F87, -1px 1px 0 #003F87, 1px 0 0 #003F87, -1px 0 0 #003F87; 
`
const DivContainer = styled.div`
display: flex;
justify-content: center;
`
const SignUpButton = styled.button`
border: #003F87 2px solid;
width: 50%;
padding: .5rem 1.5rem;
margin-top:1.5rem;
color: #003F87;
border-radius: 10px;
font-size: 1rem;
`

function SignUp(){
    return(
        <DivContainer>
            <FormHolder>
                <FontAwesomeIcon icon={faCloud} className='cloud-icon2' />
                <h1>Create Account</h1>
                <label class='label'>
                    <div>Username:</div>
                    <input type='text'/>
                </label>
                <label class='label'>
                    <div>Password:</div>
                    <input type='password'/>
                </label>
                <label class='label'>
                    <div>Email:</div>
                    <input type='text'/>
                </label>
                <label class='label'>
                    <div>Phone Number:</div>
                    <input type='text'/>
                </label>
                <SignUpButton type='submit'>Register</SignUpButton>
            </FormHolder>
        </DivContainer>
    )
}


export default SignUp;
